---This report for jane. It is about the delivery that all vendors shipment to 5040.
---Report frequency is weekly. Every Monday and time span is last week's suppliers' shipment status.
DROP TABLE DELIVERY_TAIL;
CREATE TABLE DELIVERY_TAIL AS
SELECT * FROM 
(
SELECT DELI_DETAIL.ID,
  DELI_DETAIL.DELIVERY,
  DELI_DETAIL.DELIVERY_ITEM,
  DELI_DETAIL.CREATED_BY,
  DELI_DETAIL.CREATED_TIME,
  DELI_DETAIL.CREATED_ON_DATE,
  DELI_DETAIL.PLANTID,
  DELI_DETAIL.MATERIALID,
  ITEM_INFO.CATALOG_DASH,
  ITEM_INFO.MAT_DESC,
  ITEM_INFO.STRATEGY_GRP,
  ITEM_INFO.MRP_CONTROLLER,
  ITEM_INFO.SAFETY_STOCK,
  ITEM_INFO.PROD_BU,
  ITEM_INFO.VENDOR_KEY,
  DELI_DETAIL.MVMT_TYPE,
  DELI_DETAIL.DELIVERY_QTY_SUOM,
  DELI_DETAIL.BASE_UOM,
  DELI_DETAIL.SALES_UOM,
  DELI_DETAIL.MATERIAL_AVAIL_DATE,
  DELI_DETAIL.REFERENCE_DOC_ITEM_TRIM,
  DELI_DETAIL.DELIVERY_TYPE,
  DELI_DETAIL.UPC,
  DELI_DETAIL.INCOTERMS1,
  DELI_DETAIL.INCOTERMS2,
  DELI_DETAIL.DELIVERY_PRIORITY,
  DELI_DETAIL.CHANGED_ON_DATE,
  DELI_DETAIL.ACT_GI_DATE
FROM
  (SELECT MATERIALID
    ||'_'
    || PLANTID AS ID,
    DELIVERY,
    DELIVERY_ITEM,
    CREATED_BY,
    CREATED_TIME,
    CREATED_ON_DATE,
    MATERIALID,
    PLANTID,
    CATALOGID,
    MVMT_TYPE,
    DELIVERY_QTY_SUOM,
    BASE_UOM,
    SALES_UOM,
    MATERIAL_AVAIL_DATE,
    REFERENCE_DOC_TRIM,
    REFERENCE_DOC_ITEM_TRIM,
    DELIVERY_TYPE,
    UPC,
    INCOTERMS1,
    INCOTERMS2,
    DELIVERY_PRIORITY,
    CHANGED_ON_DATE,
    ACT_GI_DATE
  FROM INV_SAP_LIKP_LIPS_DAILY 
  )DELI_DETAIL
LEFT JOIN
  (SELECT ID,
    MATERIAL,
    CATALOG_DASH,
    MRP_CONTROLLER,
    STRATEGY_GRP,
    PLANT,
    MAT_DESC,
    SAFETY_STOCK,
    PROD_BU,
    VENDOR_KEY
  FROM VIEW_INV_SAP_PP_OPT_X
  )ITEM_INFO
ON DELI_DETAIL.ID = ITEM_INFO.ID
)DELIVERY
LEFT JOIN
(

)


